import React, { Component } from "react";
import PhoneRepair from "../PhoneRepair/phoneRepair";

import styles from './phoneRepairMain.module.css';




class phoneRepairMain extends Component {

    componentDidMount(){
        window.scrollTo(0, 0);
    }

    render () {
        const phoneRepair = Object.keys(this.props.Data).map((item, index) => {
            return <PhoneRepair key={index} img={this.props.img[item]} model={item} />
        })

        return (
            <div className={styles.Main}>
                {phoneRepair}
            </div>
        )
    }
}

export default phoneRepairMain;
